import 'bootstrap/dist/css/bootstrap.min.css';

import React, { useState, useEffect } from 'react';

import {PopoverBody } from 'reactstrap';

var list = {
  fontSize : '18px',
  padding : "8px 10px",
}

var image = {
  objectFit: 'cover',
  width: '100%',

  height : '45px',
  padding: "0px 8px 0px 0px"
}



function WhisList(props) {

return (

  <PopoverBody style={list}><img style={image} src={props.img} alt=""></img>{props.Nom}     </PopoverBody>
        );}



export {WhisList};
